import { render } from '@testing-library/react';
import React, {Component} from 'react';
import Card from './Card';
import Cardlist from './Cardlist';

class App extends Component {
  constructor () {
    super()
    this.state = {
      movies: []
    }
  }
  componentDidMount() {
    const apiUrl = 'https://api.themoviedb.org/3/discover/movie?api_key=544297d08ee9679e6641d18e5056a278&language=en-US&sort_by=popularity.desc&include_adult=false&include_video=false&page=1' 
    fetch(apiUrl)
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(error => console.log('error'));
  }
}

export default App;
